import React from "react";
import styled from "styled-components";

export default function Suggest(props) {
  return (
    <ProductContainer>
      <img src={props.url} alt="제안사진" />
      <ProductInfo>
        <h4>{props.text}</h4>
        <h4>{props.price}</h4>
      </ProductInfo>
    </ProductContainer>
  );
}

export const ProductContainer = styled.div``;
